function onConfigCategoryBegin(){$.validator.unobtrusive.parse("#frmAddEditCategory")}function openCategoryModal(n){$.ajax({type:"GET",url:"ConfigChoiceCategory/AddUpdate",data:{configChoiceCategoryId:n},success:function(n){$("#categoryPartialView").html(n);$("#categoryPartialView").modal("show")}})}function saveConfigCategory(){$("#frmAddEditCategory").submit()}function addUpdateConfigCategory(n){openCategoryModal(n)}function deleteCategory(n){confirmDialog("Are you sure?",t=>{t&&$.ajax({url:"ConfigChoiceCategory/DeleteConfigChoiceCategory",data:AddAntiForgeryToken({configChoiceCategoryId:n}),type:"POST",success:function(n){ShowMessage(n.success,n.message);n.success&&$("#tblConfigCategory").bootstrapTable("refresh")}})})}function tableActions(n,t){return['<a class="like" href="javascript:void(0)" title="Edit">','<i class="fas fa-fw fa-edit" onclick="UpdateCategoryAction('+t.configChoiceCategoryId+')"  ><\/i>',"<\/a> ",'<a class="danger remove" href="javascript:void(0)" title="Remove">','<i class="fas fa-trash" onclick="DeleteCategoryAction('+t.configChoiceCategoryId+')"><\/i>',"<\/a>"].join("")}function onSaveCategorySuccess(n){ShowMessage(n.success,n.message);n.success&&($("#categoryPartialView").modal("hide"),$("#tblConfigCategory").bootstrapTable("refresh"))}